import React from "react";

function Columns(props) {
  const { column } = props;
  return (
    <div>
      <table className="columns-table">
        <thead>
          <tr>
            <th>{column.column_name}</th>
            <th>{column.data_type}</th>
          </tr>
        </thead>
        <tbody>
          {/* <tr>
            <td>{column.column_name}</td>
          </tr>
          <tr>
            <td>({column.data_type})</td>
          </tr> */}
        </tbody>
      </table>
    </div>
  );
}

export default Columns;
